def get_highest_price(plans):
    """"""
    highest_price = 0
    highest_plan = None
    for plan in plans:
        try:
            price = plan['price']
        except KeyError:
            print(f'There is no price key in {plan}')
            continue
        if price is None:
            print(f"There is no price for the plan {plan['name']}")
            continue
        if price > highest_price:
            highest_price = price
            highest_plan = plan['name']
    return highest_plan
